      border-radius: 100px;
      display: flex;
      align-items: center;
      justify-content: center;
      cursor: pointer;

      @include mq() {
        height: 75px;
        width: 75px;
      }

      &:hover {
        transition: 150ms;
        background-color: rgba(black, 0.3);
