        width: 70%;
        display: flex;
        margin-left: auto;
        margin-right: auto;
      }
    }

    &-backicon {
      position: absolute;
      z-index: -1;
    }

    .lightning {
      height: 150px;
      width: 150px;
      position: absolute;
      left: -30px;
      bottom: 90px;
      opacity: 0.5;

      @include mq() {
